    constructor(props) {
        super(props);

        this.state = { lat : null };

        window.navigator.geolocation.getCurrentPosition(
            (position) => this.setState({ lat : geolocationPosition.coords.latitude }),
            (err) => console.log(err) 
        );
    };
    render () {
        return (
            <div>
                <div>Latitude: </div>
            </div>
        );
    }
}


